import React,{ Component } from 'react';
//import logo from './logo.svg';
//import './App.css';

/*
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}
*/
class App extends Component
{
  render()
  {
    return(
      <div className="App">
       <header className="App-header">
        <center><h1>Hello React Dashboard being made by Nikunj Doshi </h1></center>
        <h2> Stay Tuned </h2>
        <p> Current Version of React : {React.version} </p>
       </header>
      </div>
    );
  }   
}


export default App;
